export default function Greeting() {

    const [greetingName, setGreetingName] = useState('');

    useEffect(async () => {
        let nameGreeting =  (await (await fetch('/name')).json())
        setGreetingName(nameGreeting.firstName);
    })
    return (
        <div>
            <h1>What will you tell the world today  {greetingName}?</h1>

        </div>
    )
}
